script: |
  super -f tsv -I q19.sql | sort > q19.out

vector: true

inputs:
  - name: q19.sql
    data: |
      SELECT DISTINCT 50 AS col2 FROM tab0 WHERE NOT ( + col0 / col1 ) NOT BETWEEN col2 * + col0 * - col0 AND + + col1 + 90 + 61;
  - name: tab0

outputs:
  - name: q19.out
    data: |
      50
